description.value:
This dataset contains deformation fields that provide a non-linear mapping between the four human template spaces that are at the core of the HBP EBRAINS platform:
     –MNI ICBM152 nonlinear 2009c asymmetric 
       [http://nist.mni.mcgill.ca/?p=904](http://nist.mni.mcgill.ca/?p=904);
     –MNI Colin27 
       [http://nist.mni.mcgill.ca/?p=935](http://nist.mni.mcgill.ca/?p=935);
     –BigBrain, 2015 release, in native histological space 
       [https://doi.org/10.1126%2Fscience.1235381](https://doi.org/10.1126%2Fscience.1235381);
     –Infant template 
       [https://doi.org/10.25493%2F49QZ-AWZ](https://doi.org/10.25493%2F49QZ-AWZ).

The cross-template transformations are diffeomorphisms, which are computed based on the alignment of the folding pattern across the different brains (DISCO method) and maximization of the grey–white matter segmentation overlap (DARTEL).
